import React from 'react';
import './App.css';
import homeIcon from './images/home-icon.png'; // Replace with your icon
import helpIcon from './images/help-icon.png';
import userIcon from './images/user-icon.png';
import globeIcon from './images/globe-icon.png';

function App() {
  return (
    <div className="App">
      <header className="header">
        <div className="header-logo">
          WiseShare
          <img src={homeIcon} alt="home icon" />
        </div>

        <div className="search-bar">
          <input type="text" placeholder="Search" />
          <button>Search</button>
        </div>

        <div className="icon-container">
          <img src={helpIcon} alt="Help" title="Help" />
          <img src={userIcon} alt="User" title="User Profile" />
          <div className="dropdown">
            <img src={globeIcon} alt="Language" title="Language" />
            <select>
              <option>English</option>
              <option>Spanish</option>
            </select>
          </div>
        </div>
      </header>
      {/* Rest of the App */}
    </div>
  );
}

export default App;
